When the game is mapped into memory the runtime then calls the game's provided event handler with the init event. So execution flow looks something like: - loadGame()
- initGame() - game.eventHandler(&self, kEventInit, 0) - eventHandlerShim(pd, evt, arg) - eventHandler(pd, evt, arg) from setup.c we know that eventHandlerShim() is just: int eventHandlerShim(PlaydateAPI* playdate, PDSystemEvent event, uint32_t arg)
{ if ( event == kEventInit ) pdrealloc = playdate->system->realloc; return eventHandler(playdate, event, arg);
} Whih is a little disappointing that they add the extra function call overhead as its only going to be used once per game session. So this is an interesting overhead addition after they (Panic Inc.) have already shown that they are both: willing to add extra sections to emitted game binary willing to arrange sections and add extra pointers to game binary Some alternatives that could reduce this (small, but passive and unavoidable) runtime overhead (ignoring the rest of the time spent in the play.date OS interrupts + runtime etc.) could be things like: add a pointer to .bss.pdrealloc in .capi, so the runtime can overwite it itself move the realloc function during the link step to change it's section, then overwrite it (though the previous idea would be considerably easier) Either way, the game program is a self contained image that is not PIC (poisiton independant code), but based at 0x60000000, and is provided a pointer to the playdate api each "interrupt."

