bss okay cool thats standard C programming stuff (initialized 0 memory), but what is .capi_handler??? According to OpenAI's ChatGPT: The .capi_handler section is a section of memory in a program that is reserved for storing data related to C++ exception handling. This data is used by the C++ runtime library to implement the C++ exception handling mechanism. In a C++ program, when an exception is thrown, the exception object is passed to the C++ runtime library, which searches for an exception handler that is capable of handling the exception. The runtime library uses the data stored in the .capi_handler section to determine which exception handlers are available and how to invoke them. The .capi_handler section is created by the linker when it links a C++ program. The linker generates the .capi_handler section based on information in the object files generated by the compiler. Cool, so it sounds like they took advantage of the fact that the input code is only C, then threw a pointer to the event handler in a section that would otherwise be unpopulated. But what is the thing they are putting in that section? eventHandlerShim() is not a user function. Shim code: int eventHandlerShim(PlaydateAPI* playdate, PDSystemEvent event, uint32_t arg)
{ if ( event == kEventInit ) pdrealloc = playdate->system->realloc; return eventHandler(playdate, event, arg);
} The shim makes sure that the allocator pointer is headed to the right place before any user game code executes. This is a pretty nice extra layer of developer nicities for us in that there is one less thing to worry about (the pdrealloc is used in their helper malloc(), free(), realloc(), implementations).
